/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<div class="ui5-list-root" @focusin="${context._onfocusin}" @keydown="${context._onkeydown}"><div class="ui5-list-scroll-container"><!-- header -->${ context.header.length ? block1(context, tags, suffix) : undefined }${ context.shouldRenderH1 ? block2(context, tags, suffix) : undefined }${ context.hasData ? block3(context, tags, suffix) : undefined }<span id="${ifDefined(context._id)}-modeLabel" class="ui5-hidden-text">${ifDefined(context.ariaLabelModeText)}</span><ul id="${ifDefined(context._id)}-listUl" class="ui5-list-ul" role="${ifDefined(context.accessibleRole)}" aria-label="${ifDefined(context.ariaLabelTxt)}" aria-labelledby="${ifDefined(context.ariaLabelledBy)}"><slot></slot>${ context.showNoDataText ? block4(context, tags, suffix) : undefined }</ul>${ context.growsWithButton ? block5(context, tags, suffix) : undefined }${ context.footerText ? block6(context, tags, suffix) : undefined }${ context.hasData ? block7(context, tags, suffix) : undefined }<span tabindex="-1" aria-hidden="true" class="ui5-list-end-marker"></span></div>${ context.busy ? block8(context, tags, suffix) : undefined }</div> `;
const block1 = (context, tags, suffix) => html`<slot name="header" />`;
const block2 = (context, tags, suffix) => html`<header id="${ifDefined(context.headerID)}" class="ui5-list-header">${ifDefined(context.headerText)}</header>`;
const block3 = (context, tags, suffix) => html`<div id="${ifDefined(context._id)}-before" tabindex="0" class="ui5-list-focusarea"></div>`;
const block4 = (context, tags, suffix) => html`<li id="${ifDefined(context._id)}-nodata" class="ui5-list-nodata" tabindex="${ifDefined(context.noDataTabIndex)}"><div id="${ifDefined(context._id)}-nodata-text" class="ui5-list-nodata-text">${ifDefined(context.noDataText)}</div></li>`;
const block5 = (context, tags, suffix) => html`<div growing-button><div tabindex="0" role="button" aria-labelledby="${ifDefined(context._id)}-growingButton-text" ?active="${context._loadMoreActive}" @click="${context._onLoadMoreClick}" @keydown="${context._onLoadMoreKeydown}" @keyup="${context._onLoadMoreKeyup}" @mousedown="${context._onLoadMoreMousedown}" @mouseup="${context._onLoadMoreMouseup}" growing-button-inner><span id="${ifDefined(context._id)}-growingButton-text" growing-button-text>${ifDefined(context._growingButtonText)}</span></div></div>`;
const block6 = (context, tags, suffix) => html`<footer id="${ifDefined(context._id)}-footer" class="ui5-list-footer">${ifDefined(context.footerText)}</footer>`;
const block7 = (context, tags, suffix) => html`<div id="${ifDefined(context._id)}-after" tabindex="0" class="ui5-list-focusarea"></div>`;
const block8 = (context, tags, suffix) => html`<div class="ui5-list-busy-row"><${scopeTag("ui5-busy-indicator", tags, suffix)} delay="${ifDefined(context.busyDelay)}" active size="Medium" class="ui5-list-busy-ind" style="${styleMap(context.styles.busyInd)}" data-sap-focus-ref></${scopeTag("ui5-busy-indicator", tags, suffix)}></div>`;


export default block0;
